`,paraId:19},{value:"\u6B64\u4F8B\u5B50 addApi\u3001updateApi \u90FD\u662F\u6A21\u62DF\u63A5\u53E3\uFF0C\u5B9E\u9645\u573A\u666F\u63A8\u8350\u4F7F\u7528 axios",paraId:20},{value:`/**
 * \u6A21\u62DF\u65B0\u589E
 * @param params \u4FDD\u5B58\u53C2\u6570
 */
export const addApi = (params: AnyKeyProps): Promise<any> => {
  return new Promise((resolve) => {
    data.unshift({
      id: Date.now(),
      sort_id: Date.now(),
      ...params,
    });
    resolve({
      msg: '\u8BF7\u6C42\u6210\u529F',
      data: Date.now(),
    });
  });
};

/**
 * \u6A21\u62DF\u4FEE\u6539
 * @param params \u4FDD\u5B58\u53C2\u6570
 */
export const updateApi = (params: AnyKeyProps): Promise<any> => {
  return new Promise((resolve) => {
    let index: number = data.findIndex((row) => row.id === params.id);
    if (index >= 0 && data[index]) {
      data[index] = {
        ...data[index],
        ...params,
      };
    }
    resolve({
      msg: '\u8BF7\u6C42\u6210\u529F',
      data: data[index],
    });
  });
};
