export default function Selection(props: AnyKeyProps) {
  const { selection, rowKey, addSelection, setSelection } =
    useContext(GSearchTableContext);
  const { data, disabledKeys } = useContext(GListContext);
  // \u83B7\u53D6\u5230\u5DF2\u9009\u4E2D\u7684\u884C\u7EC4\u6210\u7684 keys
  let keys = selection.map((row: Record) => getKey(row, rowKey));
  // \u83B7\u53D6\u5230\u6CA1\u6709\u88AB\u7981\u7528\u7684\u5217
  let noDisabledData = data.filter(
    (row: Record) => !disabledKeys.includes(getKey(row, rowKey)),
  );

  // \u662F\u5426\u5168\u9009
  const isAllChekced =
    noDisabledData.every((row: Record) => keys.includes(getKey(row, rowKey))) &&
    noDisabledData.length > 0;
  // \u662F\u5426\u534A\u9009
  const isIndeterminate =
    noDisabledData.some((row: Record) => keys.includes(getKey(row, rowKey))) &&
    !isAllChekced &&
    noDisabledData.length > 0;

  // \u5207\u6362\u9009\u4E2D
  const toggleChecked = () => {
    // \u53BB\u9009\u53D6\u6D88\u6240\u6709\u9009\u9879
    if (isAllChekced) {
      // \u5F53\u524D\u5217\u8868\u6570\u636E\u7EC4\u6210\u7684 keys
      let dataKeys = data.map((row: Record) => getKey(row, rowKey));
      // \u8FC7\u6EE4\u6389\u5F53\u524D\u9875\u9762\u6240\u6709\u7684 keys \u5269\u4E0B\u7684\u9009\u9879
      let newSelection = selection.filter(
        (row: Record) => !dataKeys.includes(getKey(row, rowKey)),
      );
      // \u8BBE\u7F6E\u65B0\u7684\u9009\u9879
      setSelection(newSelection);
    } else {
      // \u6DFB\u52A0\u65B0\u9009\u9879\uFF0C\u662F\u4E2A\u6570\u7EC4
      addSelection(
        noDisabledData.filter(
          (row: Record) => !keys.includes(getKey(row, rowKey)),
        ),
      );
    }
  };
  return (
    <Checkbox
      indeterminate={isIndeterminate}
      {...props}
      checked={isAllChekced}
      onChange={(e) => toggleChecked()}
    />
  );
}
